import React from 'react'
import UrlCard from '../../card/UrlCard'

function Articles(props) {
    let a = props.library
    return (
        <div className="LibCards">
                {
                    a.map(data => {
                        return(
                            <div className="Cards">
                                <UrlCard props={data} />
                            </div>
                        );
                    })
                }
        </div>
    )
}

export default Articles
